import * as React from "react";
import { styled, alpha } from "@mui/material/styles";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import InputBase from "@mui/material/InputBase";
import SearchIcon from "@mui/icons-material/Search";
import { useState } from "react";
import { fetchTracks } from "../../api/track/trackApi";
import { GetModel } from "../../api/track/models/CreateTrack";
import { Track } from "../../api/track/models/Track";
import { PageList } from "../../types/PageList";

const Search = styled("div")(({ theme }) => ({
  position: "relative",
  borderRadius: theme.shape.borderRadius,
  backgroundColor: alpha("#3E2723", 0.1),
  "&:hover": {
    backgroundColor: alpha("#3E2723", 0.2),
  },
  marginLeft: 0,
  width: "100%",
  [theme.breakpoints.up("sm")]: {
    marginLeft: theme.spacing(1),
    width: "auto",
  },
}));

const SearchIconWrapper = styled("div")(({ theme }) => ({
  padding: theme.spacing(0, 2),
  height: "100%",
  position: "absolute",
  pointerEvents: "none",
  display: "flex",
  alignItems: "center",
  justifyContent: "center",
  color: "#3E2723",
}));

const StyledInputBase = styled(InputBase)(({ theme }) => ({
  color: "#3E2723",
  width: "100%",
  "& .MuiInputBase-input": {
    padding: theme.spacing(1, 1, 1, 0),
    // vertical padding + font size from searchIcon
    paddingLeft: `calc(1em + ${theme.spacing(4)})`,
    transition: theme.transitions.create("width"),
    [theme.breakpoints.up("sm")]: {
      width: "12ch",
      "&:focus": {
        width: "20ch",
      },
    },
  },
}));

type Props = {
  onSearch: (results: PageList<Track>) => void;
};

export const SearchAppBar: React.FC<Props> = ({ onSearch }) => {
  const [input, setInput] = useState("");
  const [allTracks, setAlltracks] = useState<Track[]>([]);
  const [searchResults, setSearchResults] = useState<PageList<Track> | null>(
    null
  );

  const searchTrack = async (value: string) => {
    setInput(value);

    const model: GetModel = {
      page: 1,
      limit: 100,
      sort: "",
      search: value,
      genre: "",
      artist: "",
      order: "asc",
    };

    const response = await fetchTracks(model);

    if (response && response.data) {
      setAlltracks(response.data);
      setSearchResults(response);
      onSearch(response);
    } else {
      setSearchResults({
        data: [],
        meta: { page: 1, limit: 10, total: 0, totalPages: 0 },
      });
      onSearch({
        data: [],
        meta: { page: 1, limit: 10, total: 0, totalPages: 0 },
      });
    }
  };

  return (
    <Box
      sx={{
        width: "100%",
        mb: { xs: 2, sm: 2.5, md: 3 },
      }}
    >
      <Box
        sx={{
          position: "relative",
          width: "100%",
          maxWidth: 800,
          mx: "auto",
        }}
      >
        <Box
          sx={{
            display: "flex",
            alignItems: "center",
            background: "rgba(255, 255, 255, 0.95)",
            backdropFilter: "blur(20px)",
            borderRadius: 3,
            border: "1px solid rgba(102, 126, 234, 0.12)",
            boxShadow: "0 4px 20px rgba(102, 126, 234, 0.08)",
            px: { xs: 2, sm: 2.5 },
            py: 1.5,
            transition: "all 0.3s cubic-bezier(0.175, 0.885, 0.32, 1.275)",
            "&:hover": {
              background: "rgba(255, 255, 255, 1)",
              boxShadow: "0 8px 30px rgba(102, 126, 234, 0.15)",
              border: "1px solid rgba(102, 126, 234, 0.2)",
            },
            "&:focus-within": {
              background: "rgba(255, 255, 255, 1)",
              boxShadow: "0 8px 30px rgba(102, 126, 234, 0.2)",
              border: "1px solid rgba(102, 126, 234, 0.3)",
              transform: "translateY(-2px)",
            },
          }}
        >
          <SearchIcon
            sx={{
              color: "#667eea",
              mr: 1.5,
              fontSize: { xs: 24, sm: 26 },
              transition: "all 0.3s ease",
            }}
          />
          <InputBase
            placeholder="Search for tracks, artists, albums..."
            value={input}
            onChange={(e) => setInput(e.target.value)}
            onKeyDown={async (e) => {
              if (e.key === "Enter") {
                const value = (e.target as HTMLInputElement).value;
                await searchTrack(value);
              }
            }}
            sx={{
              flex: 1,
              fontSize: { xs: "0.95rem", sm: "1rem" },
              color: "#0f172a",
              fontWeight: 500,
              "& input": {
                padding: 0,
                "&::placeholder": {
                  color: "#94a3b8",
                  fontWeight: 400,
                },
              },
            }}
          />

          {/* Search button для Enter hint */}
          {input && (
            <Box
              sx={{
                display: { xs: "none", sm: "flex" },
                alignItems: "center",
                gap: 0.5,
                px: 1.5,
                py: 0.5,
                borderRadius: 1.5,
                background: "rgba(102, 126, 234, 0.08)",
                border: "1px solid rgba(102, 126, 234, 0.15)",
                ml: 1,
              }}
            >
              <Typography
                variant="caption"
                sx={{
                  color: "#667eea",
                  fontWeight: 600,
                  fontSize: "0.75rem",
                }}
              >
                Enter ↵
              </Typography>
            </Box>
          )}
        </Box>

        {/* Decorative gradient line */}
        <Box
          sx={{
            position: "absolute",
            bottom: -8,
            left: "50%",
            transform: "translateX(-50%)",
            width: "60%",
            height: 2,
            background:
              "linear-gradient(90deg, transparent 0%, #667eea 50%, transparent 100%)",
            opacity: 0.3,
            borderRadius: 2,
          }}
        />
      </Box>
    </Box>
  );
};
